A cidade de Iguaba Grande - RJ tem cada vez se consolidado como uma das referências do Estado de Rio de Janeiro no que se refere ao turismo e lazer com realizações de eventos, as belezas naturais agregadas a festividades que são tradicionais no estado e região, faz com que a cidade seja destino de visitantes de várias cidades do país, fomentando a economia local gerando emprego e renda aos munícipes;
Enfatiza-se que será a segunda vez que acontece este tipo de evento e competição no município de Iguaba Grande - RJ e para a população será uma grande expectativa, um espetáculo, fazendo assim um movimento inovador esportivo e turístico fundamental ao apoio público para sua realização e toda comunidade de forma gratuita;
O evento estará ligado diretamente à geração de renda para comerciantes em geral (bares, padarias, lanchonetes, etc.) tendo também a oferta de serviços por meio de stands no evento, além da reciclagem sustentável do lixo que o evento irá gerar, além de contar com diversas empresas que participam direta ou indiretamente do evento;
Dito isto, se torna necessário, efetivar a referida contratação e sua posterior despesa, salientando, a Inexigibilidade de Licitação, em razão do serviço a ser contratado tratar-se de evento conhecido, decorrentes de desempenhos anteriores, tornado a sua contratação de inviável competição e, indiscutivelmente os mais adequados à plena satisfação das atividades a serem realizadas, como também, pertencer à empresa a ser contratada, a exclusividade para a realização do evento supracitado, em consonância com o que preceitua o Art. 74, inciso I, da Lei Federal nº 14.133/2021.
O Art. 72, inciso I, da Lei Federal nº 14.133/2021, determina a instrução dos processos de contratação direta com Termo de Referência que subsidie a contratação, de modo que a Administração possa desta obter a maior eficiência e vantagem. A infringência do disposto neste artigo poderá implicar a nulidade dos atos ou contratos realizados e a responsabilidade de quem lhes tenha dado causa.

A contratação deste curso faz parte do projeto Fundo de Desenvolvimento dos CREFs I - Projeto de Fiscalização da Profissão de Educação Física Buscando aprimorar a atuação da equipe de fiscalização, serão realizados 2 (dois) cursos de capacitação para a equipe da fiscalização que conta hoje com 3 (três) fiscais (JULIO CESAR DE SOUZA GARCIA – JONIEL ANUNCIAÇÃO DOS SANTOS - KLEYBER RICARD MORENO SILVA) e uma assistente administrativo (VANESSA BATISTA MENDES) que terão como foco:
a) Atuação dos fiscais;
b) Atualização sobre legislação profissional e normas de fiscalização;
c)Procedimentos de autuação e documentação de irregularidades;
d)Abordagem e condução de fiscalizações em diferentes tipos de estabelecimentos;
e) Técnicas de mediação e resolução de conflitos durante as fiscalizações;
f) Investigação administrativa, procedimento apuratório e as melhores práticas no processo ético disciplinar e fiscalizatório 
O Serviço a ser contratado são dois cursos presenciais, com a inscrição de 4 servidores do setor da fiscalização do CREF 17/MT, sendo: CURSO: INVESTIGAÇÃO ADMINISTRATIVA PROCEDIMENTO APURATÓRIO E AS MELHORES PRÁTICAS NO PROCESSO ÉTICO-DISCIPLINAR E FISCALIZATÓRIO. Carga Horária: 16 horas
